import React, { useState, useEffect } from 'react';
import { Outlet } from 'react-router-dom';
import Navbar from './Navbar';


function Home() {
  const [data, setData] = useState([]);
  const [count, setCount] = useState(0);

  const request = () => setCount((prev) => prev + 1);

  useEffect(() => {
    fetch('http://localhost:3000/data')
      .then((res) => res.json())
      .then((intel) => setData(intel))
      .catch((error) => console.log(`Your error: ${error}`));
  }, [count]);

  console.log(data);

  const msg = data.message || 'No message available';

  return (
    <div>
      <Navbar />
      <h1>Hello</h1>
      <h3>{msg}</h3>
      <button onClick={request}>Requests: {count}</button>
      <Outlet context={{ data, setData }} />
    </div>
  );
}

export default Home;
